激乾 ふとん除湿・脱臭シート<br>ブランド：激乾<br>販売・製造元：フマキラー<br><br>お天気次第の布団干しに変わって毎日お役に立つのがこのシートです。<br>敷き布団の下やベッドパッドの下に敷くだけで、パワフルな除湿能力を発揮します。<br>脱臭・防カビ効果もあり、ダニの繁殖を防ぎます。<br>天日干しによる再生で、6ヶ月間繰り返し使用可能なので経済的です。<br>吸湿状態がひと目でわかる再生サイン付です。<br>除湿量は400mlです。<br> <br><br>日用品／家庭用品／除湿剤・乾燥剤／除湿剤 寝具用<br>JANコード： 4902424410693<br><br>CS：10<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
