ルック まめピカ トイレクリーナー つめかえ用 190ml<br>ブランド：ルック<br>販売・製造元：ライオン<br><br>トイレットペーパーを使ってサッとひとふきできるトイレ用洗剤です。<br>トイレットペーパーがボロボロにならないから、気軽に拭き掃除ができます。<br>毎日使っても約3ヶ月分(700プッシュ)。<br>フレッシュアップルの香り。<br>詰め替え用。<br> <br>用途便座・便器のふち、便器の外全体、床等の拭き掃除使えないもの：白木、銅、しんちゅう、大理石等の石材(ワックス処理した塗装面、色落ち・シミの心配があるものは目立たない部分で試してから使う) <br><br>使用方法<br>使用量の目安：便座の表側全体には約2回噴射。<br>床30cm四方に対し1回噴射。<br>●スプレーしてトイレットペーパーで拭き取る。<br>ま●トイレットペーパーは適量とり、4、5回折りたたんで使う。<br>●除菌する場合除菌した部分に液がかかるようスプレーし、5分おいてから拭き取る。<br>(すべての菌を除去するわけではありません。<br>)ボトルへのつめかえ方●必ず「まめピカ」の使用済みボトルにつめかえてください。<br>●ボトル側面の「つめかえライン」まで液面が下がったら、つめかえてください。<br>●一度に全量をつめかえてください。<br>(1)パックを切る：点線にそって持ち上げるように切る。<br>※ パックを強く持って切ると、液が飛び出すことがありますので、ご注意ください。<br>(2)ボトルに差し込み、注ぐ：注ぎ口を差し込み、底部からゆっくり注ぐ。<br>(3)ノズルをセットする：ノズルとチューブは左方向に向けてセットする。<br> <br><br>使用上の注意<br>●用途外に使わない。<br>●乳幼児の手の届くところに置かない。<br>●人に向けてスプレーしない。<br>●目より高い位置にスプレーしない。<br>●高温、直射日光を避けて保管する。<br>●換気をよくして使用する。<br>●荒れ性の方は炊事用手袋を使用する。<br>●使用後は手を水でよく洗う。<br>●温水洗浄ノズル・温風出口・スイッチは、トイレットペーパーにスプレーして拭き取る。<br>●火気の近くで使わない。<br>●つまりを避けるため、一度に多くのトイレットペーパーや水で流せない紙類は流さない。<br> 応急処置●目に入ったときはこすらずすぐに水で十分洗い流す。<br>●飲み込んだときは水を飲ませる。<br>●異常があるときは商品を持参し、医師に相談する。<br> <br>成分<br>界面活性剤(2% アルキルベタイン)、溶剤(エチルアルコール)液性：中性 <br><br>お問い合わせ先<br>ライオン株式会社：0120-556-973 <br>日用品／掃除用品／掃除用洗剤／洗剤 トイレ用<br>JANコード： 4903301118336<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
