トイレのファブリーズアロマ グリーンアロマの香り<br>ブランド：ファブリーズ<br>販売・製造元：P&G(プロクター・アンド・ギャンブル)<br><br>ニオイキャッチャーゼリーがアンモニア臭を中和して、しっかり消臭する芳香剤です。<br>トイレは放っておくと、どんどんアンモニア臭が増えてしまいます。<br>トイレのファブリーズは強い香りでごまかすのではなく、アンモニア臭を中和してしっかり消臭します。<br>しっかり消臭するから、 ほのかで自然な香りが楽しめます。<br>グリーンアロマの香り。<br> <br><br>用途トイレ用 <br><br>使用方法<br>(1)香りオイルをセット(オイルが手前、山が上)。<br>(2)もっと香りが欲しい場合は、カバーを上にあげ、ドット面を手前に。<br>●使用期間約60日(風通しのよい場所や高温になる場所では、早まることがあります) <br><br>使用上の注意<br>・香りオイルの中身を取り出さないでください。<br>・用途以外に使用しないでください。<br>・本品は食べられません。<br>・幼児の手の届かないところにおいてください。<br>・火気の付近で使用しないでください。<br>・安定したところに置いて使用してください。<br>・直射日光の当たるところや、温度が40度を超えるところでの保管・使用は避けてください。<br>・電化製品の上などでは、熱くなることがあるので使用しないでください。<br>・香りオイルを単独で放置しないでください。<br>・家具や電化製品などに直接接すると表面が変質することがあります。<br>・製品を振らないでください。<br>内容物が飛び出ることがあります。<br>内容物がこぼれた場合はすぐにふき取ってください。<br> 応急処置・もし、誤って口に入れた場合は、すぐに水を飲ませるなどの応急処置をし、医師にご相談ください。<br>・万一、皮膚に付いたり、目に入ったりした場合はすぐに水で充分に洗い流してください。<br> <br>成分<br>香料<br> 原産国中国 <br><br>お問い合わせ先<br>P&G(プロクター・アンド・ギャンブル・ジャパン)株式会社お客様相談室 0120-021321 消臭剤全部とは消臭剤は、お部屋やトイレ、車の中など、あらゆる空間の嫌なニオイを消す商品です。<br>屋外用、業務用の消臭剤から、赤ちゃんがいても使える自然派の消臭剤まで豊富なラインナップ。<br>消臭スプレー、消臭シール・消臭ボトル等、用途に合った消臭剤をお選び下さい。<br><br>日用品／家庭用品／消臭・芳香剤／消臭剤 トイレ用<br>JANコード： 4902430288095<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
