クリアターン ホワイトマスク コラーゲン 5回分<br>ブランド：クリアターン<br>販売・製造元：コーセーコスメポート<br><br>海洋性コラーゲン配合の美容液をたっぷりと含んだ、シートタイプのパックです。<br>更に、ゆりの球根から抽出したビタミンCを豊富に含む、白百合エキスも配合。<br>吸い付くような密着感で、マスクが心地良くお肌にフィット。<br>美容液を角質層のすみずみまで送り届け、ふっくらはずむようなハリ感のあるお肌に導きます。<br>弱酸性、無香料、無着色、ノンアルコール。<br> <br><br><br>使用方法<br>1.袋からマスクを取り出し、マスクをひろげます。<br>シートの目もとの部分を外側にして折り返します。<br>2.最初に目の位置、次に口の位置を合わせてから顔全体にのせ、空気が入らないように軽くおさえるようにして肌に密着させます。<br>3.目もとをケアする場合は、最後に折り返した部分を目元をおおうように密着させます。<br>(*目の上にご使用になるときは、液が目に入らないように必ず目を閉じてご使用ください。<br>コンタクトレンズをご使用の方は、あらかじめはずしてからお使いください。<br>)4.そのまま10分くらいおいてからマスクをとります。<br>そのあと肌に残った美容液を手のひらでなじませるとより効果的です。<br> <br><br>使用上の注意<br>・傷やはれもの、湿しん等、お肌にに異常のあるときはお使いにならないでください。<br>・使用中、赤み、はれ、かゆみ、刺激等の異常があらわれた場合は、ご使用を中止し、皮ふ科専門医等へご相談ください。<br>そのまま使用を続けますと、症状が悪化することがあります。<br> <br>成分<br>水、BG、グリセリン、DPG、PEG-8、ユリエキス、水溶性コラーゲン、イソステアリン酸PEG-50水添ヒマシ油、カルボマー、トリエチルヘキサノイン、水酸化ナトリウム、イソブチルパラベン、エチルパラベン、ブチルパラベン、プロピルパラベン、メチルパラベン パック シートタイプとは美容成分を染みこませたシートや、一定時間なじませてから洗い流したり拭き取るパック剤です。<br><br>化粧品／パック・ピーリング／パック／パック シートタイプ<br>JANコード： 4971710308631<br><br>CS：48<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
