キッチンの壁面に貼り、油汚れ等から守る。貼り直し可能でキレイに貼れる。のり残りの心配がなくはがした後もキレイ。<br><br><br>きれいに貼れる吸着シート レンガ調<br>キッチン壁面の汚れを防ぐガスコンロカバーです。接着のりを使用しない吸着シートなので、のり残りの心配がなく、何度も貼り直しができ、きれいに貼れます。 用途この製品は、キッチンの壁面に貼り、油汚れ等から守るためのものです。<br> 使用方法：●準備1.壁面をきれいにします。中性洗剤等でほこりや油汚れなどをきれいにします。洗剤や水分が残らないように拭き取ってください。2.必要な長さに切ります。この製品には、裏フィルムをはがすためのはがし口シールが付いています。製品を切る場合には、はがし口シールが残るように切ってください。<br>●貼り方1.はがし口シールをつまんで透明の裏フィルムを端から5cm程度はがします。2.シートの端を壁面に貼ります。残りの裏フィルムを少しずつはがしながら、タオルを使い外に向かって空気を押し出しながら貼ってください。<br>●裏フィルムをはがした後の貼り方(この製品は接着剤を使わない吸着タイプなので貼り直しができます)1.裏フィルムを全部はがしたシートを水平にし、上から5cm程度仮貼りします。2.タオルを使ってシートの中央をタテに貼ります。ここを基準線とします。3.基準線から左半分を一旦はがし、再度基準線からタオルを使い、外に向かって空気を押し出しながら貼ります。残り半分も同じように貼ります。 使用上の注意●火が直接当たるところや熱のかかるところへのご使用は絶対におやめください。<br>●ステンレス製等金属の壁面と吸着シートの間に水分が入り込んだ場合に、壁面が変色することがありますので、ご注意ください。<br>●割れる恐れがありますので、窓ガラスには使用しないでください。<br>●製品の表面についた汚れを拭く際には、水分をよく切ったスポンジ等やわらかいもので軽く拭いてください。水分の多く含んだもので端をこすりますと、シートが壁からはがれますのでご注意ください。<br>●1年をめどにお取替えください。長期間経過してはがすと、吸着層が壁面に残ることがあります。<br>●万一、吸着層が壁面に残った場合は、濡れふきんで軽く拭き取ってください。<br>●使用目的以外の使用はしないでください。<br>●ゴミとして処理する場合は、お住まいの自治体の区分に従ってください。 <br>ご注意：●下記のような壁面には使えません。木製、土壁、素焼きのタイル等のザラザラ面やデコボコ面(吸着しません)。 材質吸着加工ポリエステルフィルム <br>原産国：日本<br><br> お問い合わせ先：東洋アルミエコープロダクツ株式会社〒541-0053 大阪市中央区本町2丁目1-6お客様相談室0120-123-701(平日/10時-17時)  <br>販売_製造元： 東洋アルミエコープロダクツ<br>ブランド：<br>JAN：4901987228028<br>CS：60<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
